INSERT INTO kl_app(app_id,app_name,category_id,version,description,logo,detail,app_start_item,base_package_version,type,charts,rich_text_detail,sort,runnable,image_url) VALUES (82,'地震数据分析与评价',3,1.0,'地震数据分析与评价','','地震数据分析与评价（KL-DataAE）是 KLSeis系统中的一个应用软件，其主要功能包括频谱分析、时变能量分析、时频分析、信噪比分析、F-K 分析、信噪比谱分析、能量分析、自相关分析等八种属性的交互分析，以及对上述属性和噪音情况的批量统计分析。该软件通常安装在地震队营地的计算机上，主要用于施工前期地震采集试验数据的交互分析和属性对比，以确定最佳的施工参数，也可以在施工过程中或施工结束后，用于对部分区域或全区的地震数据的批量处理、统计分析及分级评价，通过多种属性的分析实现对地震数据品质的定性和定量分析与评价。在地震采集方法设计阶段，也可用该软件进行老资料品质分析，为确定合理的采集方案和参数提供依据。','KL-DataAE.exe','V1.0.0',1,'["/appImages/KL-DataAE-Chart-1.png","/appImages/KL-DataAE-Chart-2.png","/appImages/KL-DataAE-Chart-3.png"]','地震数据分析与评价（KL-DataAE）是 KLSeis系统中的一个应用软件，其主要功能包括频谱分析、时变能量分析、时频分析、信噪比分析、F-K 分析、信噪比谱分析、能量分析、自相关分析等八种属性的交互分析，以及对上述属性和噪音情况的批量统计分析。该软件通常安装在地震队营地的计算机上，主要用于施工前期地震采集试验数据的交互分析和属性对比，以确定最佳的施工参数，也可以在施工过程中或施工结束后，用于对部分区域或全区的地震数据的批量处理、统计分析及分级评价，通过多种属性的分析实现对地震数据品质的定性和定量分析与评价。在地震采集方法设计阶段，也可用该软件进行老资料品质分析，为确定合理的采集方案和参数提供依据。',0,0,NULL);
INSERT INTO kl_app(app_id,app_name,category_id,version,description,logo,detail,app_start_item,base_package_version,type,charts,rich_text_detail,sort,runnable,image_url) VALUES (83,'地震数据转储与质量监控',3,1.0,'地震数据转储与质量监控','','地震数据转储与质量监控（KL-SeisPro）是 KLSeis系统中的一个应用软件，其主要功能包括数据转储和数据质控两大部分，是集地震数据拷贝与转储、质量控制及数据分析功能为一体的专用软件。在数据转储方面，支持磁盘、磁带多份同步输出，适用于 428、G3i、Zland、GSR 等仪器的 SEG-D2.0 和 3.0 格式数据拷贝；支持 SEG-D 与 SEG-Y 之间、SEG-D 或 SEG-Y 到 GeoEast 的数据转储；支持硬拷贝和数据格式解析；支持数据合并、拆分等操作方式。在数据质控方面，能够通过振幅与频率分析及频谱分析判断可疑炮；通过文件头/道头与 SPS 的关系进行质控；能检查磁盘数据与磁带数据是否一致，确保数据拷贝的正确性。该软件主要服务于高效采集项目的地震数据从磁盘到磁带的拷贝，最终以磁带方式提交甲方；也可以用于从野外磁盘到室内磁盘的转储或格式转换，更方便的用于现场处理；也可用于室内地震数据处理，如磁带解编，SEG-Y 数据截短与合并供静校正软件拾取初至应用等；该软件一般安装在地震队营地的计算机上，在地震数据采集的当天或次日实现对单炮数据的快速转储与拷贝，并在拷带的同时进行质量监控。KL-SeisPro 还可以用于老资料的数据转储，并提供了数据解析的功能，对无法识别的数据格式的情况下，可通过详细解析来确定数据格式。','KL-SeisPro.exe','V1.0.0',1,'["/appImages/KL-SeisPro-Chart-1.png","/appImages/KL-SeisPro-Chart-2.png","/appImages/KL-SeisPro-Chart-3.png"]','地震数据转储与质量监控（KL-SeisPro）是 KLSeis系统中的一个应用软件，其主要功能包括数据转储和数据质控两大部分，是集地震数据拷贝与转储、质量控制及数据分析功能为一体的专用软件。在数据转储方面，支持磁盘、磁带多份同步输出，适用于 428、G3i、Zland、GSR 等仪器的 SEG-D2.0 和 3.0 格式数据拷贝；支持 SEG-D 与 SEG-Y 之间、SEG-D 或 SEG-Y 到 GeoEast 的数据转储；支持硬拷贝和数据格式解析；支持数据合并、拆分等操作方式。在数据质控方面，能够通过振幅与频率分析及频谱分析判断可疑炮；通过文件头/道头与 SPS 的关系进行质控；能检查磁盘数据与磁带数据是否一致，确保数据拷贝的正确性。该软件主要服务于高效采集项目的地震数据从磁盘到磁带的拷贝，最终以磁带方式提交甲方；也可以用于从野外磁盘到室内磁盘的转储或格式转换，更方便的用于现场处理；也可用于室内地震数据处理，如磁带解编，SEG-Y 数据截短与合并供静校正软件拾取初至应用等；该软件一般安装在地震队营地的计算机上，在地震数据采集的当天或次日实现对单炮数据的快速转储与拷贝，并在拷带的同时进行质量监控。KL-SeisPro 还可以用于老资料的数据转储，并提供了数据解析的功能，对无法识别的数据格式的情况下，可通过详细解析来确定数据格式。',0,0,NULL);
INSERT INTO kl_app(app_id,app_name,category_id,version,description,logo,detail,app_start_item,base_package_version,type,charts,rich_text_detail,sort,runnable,image_url) VALUES (93,'初至拾取',4,1.0,'初至拾取','','初至拾取（KL-FBPicker）是 KLSeis下的一个应用软件。KL-FBPicker 用于二维、三维地震数据的初至拾取：即自动或交互拾取每炮每道的初至时间，供后续的静校正计算使用。初至拾取的基本原理：本方法是一种基于能量比迭代拾取地震道初至波的自动拾取方法，该方法首先计算地震数据两个相邻时窗的能量比，并从比值特征和设置的能量参数中确定初至；然后利用一定的判定条件对初至进行评价，确定可信度低的初至，最后重新拾取可信度系数低的初至。初至拾取（KL-FBPicker）是 KLSeis系统中专门用于初至波旅行时间拾取的软件，其主要功能包括不同格式的基础数据导入、观测系统定义与质控、自动拾取、交互拾取、初至编辑及质控、初至输出等。该软件主要用于地震数据采集完成后，基于初至波走时的静校正方法计算前，为折射静校正、层析静校正、初至波剩余静校正和初至波二次定位等方法提供基础数据。','KL-FBPicker.exe','V1.0.0',1,NULL,'初至拾取（KL-FBPicker）是 KLSeis下的一个应用软件。KL-FBPicker 用于二维、三维地震数据的初至拾取：即自动或交互拾取每炮每道的初至时间，供后续的静校正计算使用。初至拾取的基本原理：本方法是一种基于能量比迭代拾取地震道初至波的自动拾取方法，该方法首先计算地震数据两个相邻时窗的能量比，并从比值特征和设置的能量参数中确定初至；然后利用一定的判定条件对初至进行评价，确定可信度低的初至，最后重新拾取可信度系数低的初至。初至拾取（KL-FBPicker）是 KLSeis系统中专门用于初至波旅行时间拾取的软件，其主要功能包括不同格式的基础数据导入、观测系统定义与质控、自动拾取、交互拾取、初至编辑及质控、初至输出等。该软件主要用于地震数据采集完成后，基于初至波走时的静校正方法计算前，为折射静校正、层析静校正、初至波剩余静校正和初至波二次定位等方法提供基础数据。',0,0,NULL);
INSERT INTO kl_app(app_id,app_name,category_id,version,description,logo,detail,app_start_item,base_package_version,type,charts,rich_text_detail,sort,runnable,image_url) VALUES (80,'三维模型正演与照明',2,1.0,'三维模型正演与照明','','三维模型正演与照明是一套集三维模型加载及预处理、三维观测系统布设及导入、波动方程正演照明分析功能为一体的地震采集辅助软件，可以为复杂区的三维地震采集观测系统优化提供参考。','KL-3DModeling.exe','V1.0.0',1,'["/appImages/KL-3DModeling-Chart-1.png","/appImages/KL-3DModeling-Chart-2.png","/appImages/KL-3DModeling-Chart-3.png"]','三维模型正演与照明是一套集三维模型加载及预处理、三维观测系统布设及导入、波动方程正演照明分析功能为一体的地震采集辅助软件，可以为复杂区的三维地震采集观测系统优化提供参考。',1,0,NULL);
