INSERT INTO kl_app(app_id,app_name,category_id,version,description,logo,detail,app_start_item,base_package_version,type,charts,rich_text_detail,sort,runnable,image_url) VALUES (94,'层析静校正',4,1.0,'层析静校正','','层析静校正是 KLSeis下的一个应用软件。包括单尺度网格层析、多尺度网格层析和可形变层析三种层析静校正方法，以及初至剩余静校正方法。对于不同的表层结构特点地区具有较强的适应性，能够解决长波长和大的短波长静校正问题。','KL-TomoStatics.exe','V1.0.0',1,NULL,'层析静校正是 KLSeis下的一个应用软件。包括单尺度网格层析、多尺度网格层析和可形变层析三种层析静校正方法，以及初至剩余静校正方法。对于不同的表层结构特点地区具有较强的适应性，能够解决长波长和大的短波长静校正问题。',0,0,NULL);
INSERT INTO kl_app(app_id,app_name,category_id,version,description,logo,detail,app_start_item,base_package_version,type,charts,rich_text_detail,sort,runnable,image_url) VALUES (96,'模型静校正',4,1.0,'模型静校正','','模型静校正（KL-SCStatics）是 KLSeis下的一个应用软件。KL-SCStatics用于二维、三维模型法静校正量计算。模型静校正：一种基于表层调查成果数据的建模方法，包括关系系数、时深曲线和规则网格数据库等建模功能。','KL-LVLStatics.exe','V1.0.0',1,'["/appImages/KL-LVLStatics-Chart-1.png","/appImages/KL-LVLStatics-Chart-2.png","/appImages/KL-LVLStatics-Chart-3.png"]','模型静校正（KL-LVLStatics）是 KLSeis下的一个应用软件。KL-SCStatics用于二维、三维模型法静校正量计算。模型静校正：一种基于表层调查成果数据的建模方法，包括关系系数、时深曲线和规则网格数据库等建模功能。',0,0,NULL);
INSERT INTO kl_app(app_id,app_name,category_id,version,description,logo,detail,app_start_item,base_package_version,type,charts,rich_text_detail,sort,runnable,image_url) VALUES (91,'拖缆地震采集实时质控',5,1.0,'拖缆地震采集实时质控','','拖缆地震采集实时质控软件（KL-StreamerRtQC）是为海上拖缆采集作业研发的资料进行实施质量控制的软件，能够实时监控拖缆采集中资料各项指标，获取采集的道集数据，根据对数据的叠加、分析，得到不同域的能量变化，监控炮、道、缆及气枪激发状态等，弥补导航系统、仪器记录系统、气枪控制系统所不能完成的在线实时质量控制功能，监控拖缆设备工作状态，以指导现场采集工作，保证拖缆作业采集质量和生产效率。','KL-StreamerRtQC.exe','V1.0.0',1,'["/appImages/KL-StreamerRtQC-Chart-1.png","/appImages/KL-StreamerRtQC-Chart-2.png","/appImages/KL-StreamerRtQC-Chart-3.png"]','拖缆地震采集实时质控软件（KL-StreamerRtQC）是为海上拖缆采集作业研发的资料进行实施质量控制的软件，能够实时监控拖缆采集中资料各项指标，获取采集的道集数据，根据对数据的叠加、分析，得到不同域的能量变化，监控炮、道、缆及气枪激发状态等，弥补导航系统、仪器记录系统、气枪控制系统所不能完成的在线实时质量控制功能，监控拖缆设备工作状态，以指导现场采集工作，保证拖缆作业采集质量和生产效率。',0,0,NULL);
INSERT INTO kl_app(app_id,app_name,category_id,version,description,logo,detail,app_start_item,base_package_version,type,charts,rich_text_detail,sort,runnable,image_url) VALUES (88,'气枪实时监控',5,1.0,'气枪实时监控','','气枪实时质控软件功能上实现对气枪属性和近场子波的实时质控、气泡测试、近场子波模拟远场子波，并提供对各类气枪属性的统计分析。气枪属性实时监控，通过实时读取枪控器的属性数据，以柱状图的方式显示在监控界面上，通过阈值判断，监控气枪属性的异常值。近场子波实时监控，通过图形定性显示和计算定量分析两种方式监控。一是将近场子波按照四种方式进行排齐，以图形显示方式定性监控近场子波的变化趋势；二是将近场子波定量分析计算近场子波的最大振幅值、均方根振幅值、互相关系数等定量监控近场子波的形状变化。气泡测试，通过导入气泡测试的参数及数据，将人工测试流程软件话，能实现气泡测试数据的自动筛选排齐显示、交互拾取主峰值及气泡峰值时间，自动计算测试结果及结果导出。近场子波模拟远场，通过设置的模拟参数，在实时质控时逐炮将每炮近场近场子波数据模拟成一道远场子波数据，并支持远场子波的显示及导出。气枪属性数据统计分析，可采用平面图、柱状图、表格方式进行统计问题气枪，便于整条测线气枪属性的快捷分析。','KL-AGQC.exe','V1.0.0',1,'["/appImages/KL-AGQC-Chart-1.png","/appImages/KL-AGQC-Chart-2.png","/appImages/KL-AGQC-Chart-3.png"]','气枪实时质控软件（KL-AGQC）通过气枪属性和近场子波实时分析，快速发现气枪状态异常，可对整测线数据进行统计分析，也可用于气泡测试和远场子波实时模拟。主要特色包括：（1）支持多种枪控器及数据类型；（2）实时分析Delta、Misfire、Autofire、Depth、Pressure、Spread六大属性；（3）多种形式的近场子波实时排齐显示；（4）Bubble test；（5）改为近场子波模拟远场。',0,0,NULL);
INSERT INTO kl_app(app_id,app_name,category_id,version,description,logo,detail,app_start_item,base_package_version,type,charts,rich_text_detail,sort,runnable,image_url) VALUES (77,'全目标三维地震采集设计',1,1.0,'全目标三维地震采集设计','','待更新','KL-ATSADesign.exe','V1.0.0',1,'["/appImages/KL-ATSADesign-Chart-1.png","/appImages/KL-ATSADesign-Chart-2.png","/appImages/KL-ATSADesign-Chart-3.png"]','基于地物信息和地质目标特征，形成面向成像点的采集参数论证、基于均匀对称的交错设计及基于人工智能炮检点分级布设等功能，实现了“均匀随机布设、适宜网格采集、灵活面元成像”。',2,0,NULL);
INSERT INTO kl_app(app_id,app_name,category_id,version,description,logo,detail,app_start_item,base_package_version,type,charts,rich_text_detail,sort,runnable,image_url) VALUES (79,'二维模型正演与照明',2,1.0,'二维模型正演与照明','','二维模型正演与照明是一套包括二维复杂构造建模、波场数值模拟（8种方法）、照明能量分析（2种方法）和成像分析等功能的综合应用软件，是在复杂地表和复杂构造区进行地震勘探采集设计的有效辅助工具。','KL-2DModeling.exe','V1.0.0',1,'["/appImages/KL-2DModeling-Chart-1.png","/appImages/KL-2DModeling-Chart-2.png","/appImages/KL-2DModeling-Chart-3.png"]','二维模型正演与照明是一套包括二维复杂构造建模、波场数值模拟（8种方法）、照明能量分析（2种方法）和成像分析等功能的综合应用软件，是在复杂地表和复杂构造区进行地震勘探采集设计的有效辅助工具。',0,0,NULL);
INSERT INTO kl_app(app_id,app_name,category_id,version,description,logo,detail,app_start_item,base_package_version,type,charts,rich_text_detail,sort,runnable,image_url) VALUES (85,'可控震源与接收系统质量分析',3,1.0,'可控震源与接收系统质量分析','','可控震源与接收系统质量分析（Vibrator and Recorder Quality Analysis）是KLSeis系统可控震源系列软件中一个应用软件。可控震源和接收系统质量控制分析是可控震源施工中一个关键环节，目前 VibEQA 软件不仅能够完成可控震源和接收系统设备工作状态的质量控制和数据管理，还可以方便对资料快速有效的分析、汇总、展示，方便野外施工质量监控。该软件主要用于陆上地震采集设备（可控震源和接收系统）工作状态的室内质控环节，一般用于当天或前一个施工日的数据质控，也可用于施工后一定时期内的数据进行质控分析，属于事后的质控及验证分析。软件各功能模块相对比较独立，使用的主要流程都是先添加质控数据文件到数据树，然后从数据树或菜单打开，最后查看各项结果图件和 QC 报告等。','KL-VibEQA.exe','V1.0.0',1,NULL,'可控震源与接收系统质量分析（Vibrator and Recorder Quality Analysis）是KLSeis系统可控震源系列软件中一个应用软件。可控震源和接收系统质量控制分析是可控震源施工中一个关键环节，目前 VibEQA 软件不仅能够完成可控震源和接收系统设备工作状态的质量控制和数据管理，还可以方便对资料快速有效的分析、汇总、展示，方便野外施工质量监控。该软件主要用于陆上地震采集设备（可控震源和接收系统）工作状态的室内质控环节，一般用于当天或前一个施工日的数据质控，也可用于施工后一定时期内的数据进行质控分析，属于事后的质控及验证分析。软件各功能模块相对比较独立，使用的主要流程都是先添加质控数据文件到数据树，然后从数据树或菜单打开，最后查看各项结果图件和 QC 报告等。',0,0,NULL);
INSERT INTO kl_app(app_id,app_name,category_id,version,description,logo,detail,app_start_item,base_package_version,type,charts,rich_text_detail,sort,runnable,image_url) VALUES (84,'地震辅助数据工具包',3,1.0,'地震辅助数据工具包','','地震辅助数据工具包软件（KL-ADTools）是 KLSeis系统中的一个应用软件，主要用于处理 SPS 文件、电子班报、VAPS 文件等地震勘探采集中产生的辅助数据，主要功能包括观测系统建立、数据处理、电子班报、生产效率分析，另外，还可以进行二维和三维观测系统打印，以及不同版本 SPS 数据格式的转换等。该软件通常安装到地震队营地解释组的计算机上，主要应用于野外采集过程中地震辅助数据整理。按照野外采集施工流程，主要完成四方面的工作，（1）根据炮检点实际位置建立观测系统，导出 SPS，给仪器操作员进行放炮；（2）对仪器返回的 SPS 数据，按照甲方的要求进行处理，形成上交给甲方的格式文件；（3）利用处理的辅助数据，生成符合各探区格式要求的电子班报；（4）利用仪器返回的 VAPS 数据，对生产效率进行统计分析。','KL-ADTools.exe','V1.0.0',1,'["/appImages/KL-ADTools-Chart-1.png","/appImages/KL-ADTools-Chart-2.png","/appImages/KL-ADTools-Chart-3.png"]','地震辅助数据工具包软件（KL-ADTools）是 KLSeis系统中的一个应用软件，主要用于处理 SPS 文件、电子班报、VAPS 文件等地震勘探采集中产生的辅助数据，主要功能包括观测系统建立、数据处理、电子班报、生产效率分析，另外，还可以进行二维和三维观测系统打印，以及不同版本 SPS 数据格式的转换等。该软件通常安装到地震队营地解释组的计算机上，主要应用于野外采集过程中地震辅助数据整理。按照野外采集施工流程，主要完成四方面的工作，（1）根据炮检点实际位置建立观测系统，导出 SPS，给仪器操作员进行放炮；（2）对仪器返回的 SPS 数据，按照甲方的要求进行处理，形成上交给甲方的格式文件；（3）利用处理的辅助数据，生成符合各探区格式要求的电子班报；（4）利用仪器返回的 VAPS 数据，对生产效率进行统计分析。',0,0,NULL);
INSERT INTO kl_app(app_id,app_name,category_id,version,description,logo,detail,app_start_item,base_package_version,type,charts,rich_text_detail,sort,runnable,image_url) VALUES (81,'地震采集实时监控',3,1.0,'地震采集实时监控','','地震采集实时监控（KL-RtQC）是 KLSeis系统中的一个应用软件，其主要功能包括对地震采集数据各种属性的质控、可控震源工作状态属性的质控以及各种属性质控结果的统计分析。在地震数据属性质控方面，适用于英洛瓦公司的G3i 仪器和 Scorpion 仪器，Sercel 公司的 408 和 428 仪器以及东方地球物理公司的 ES109 仪器等常用仪器类型，能够对地震数据品质（能量、频率、信噪比等）、采集参数和噪音等属性进行实时分析与评价。在可控震源工作状态质控方面，能够对出力、相位、畸变等属性以及 TD 规则检查、状态码、停工时间的实时监控。KL-RtQC 软件主要应用于地震采集施工现场的实时监控，是野外采集现场质控的重要环节。质控计算机安装仪器车上，通过网线与采集仪器连接，对有问题单炮和设备进行报警提示，及时通知操作员进行处理，避免大面积废炮。同时，为适应高效、高密度地震勘探采集项目的需求，该软件在大数据量处理和高效运算方面具备较优秀的性能。','KL-RtQC.exe','V1.0.0',1,'["/appImages/KL-RtQC-Chart-1.png","/appImages/KL-RtQC-Chart-2.png","/appImages/KL-RtQC-Chart-3.png"]','地震采集实时监控（KL-RtQC）是 KLSeis系统中的一个应用软件，其主要功能包括对地震采集数据各种属性的质控、可控震源工作状态属性的质控以及各种属性质控结果的统计分析。在地震数据属性质控方面，适用于英洛瓦公司的G3i 仪器和 Scorpion 仪器，Sercel 公司的 408 和 428 仪器以及东方地球物理公司的 ES109 仪器等常用仪器类型，能够对地震数据品质（能量、频率、信噪比等）、采集参数和噪音等属性进行实时分析与评价。在可控震源工作状态质控方面，能够对出力、相位、畸变等属性以及 TD 规则检查、状态码、停工时间的实时监控。KL-RtQC 软件主要应用于地震采集施工现场的实时监控，是野外采集现场质控的重要环节。质控计算机安装仪器车上，通过网线与采集仪器连接，对有问题单炮和设备进行报警提示，及时通知操作员进行处理，避免大面积废炮。同时，为适应高效、高密度地震勘探采集项目的需求，该软件在大数据量处理和高效运算方面具备较优秀的性能。',0,0,NULL);
INSERT INTO kl_app(app_id,app_name,category_id,version,description,logo,detail,app_start_item,base_package_version,type,charts,rich_text_detail,sort,runnable,image_url) VALUES (95,'折射静校正',4,1.0,'折射静校正','','折射静校正（ KL-RefraStatics ）是 KLSeis下的一个应用软件。KL-RefraStatics 用于二维、三维初至折射层位划分及折射静校正量计算。折射静校正（KL-RefraStatics）是 KLSeis系统中基于初至波走时的折射法近地表建模与静校正计算软件。其主要功能包括基础数据的导入、观测系统定义与质控、折射速度计算（互换法、CMP 域拟合法）、延迟时计算（高斯迭代法、EGRM 方法、混合法等）、模型反演、折射静校正量计算、初至波剩余静校正量计算及相应的质量监控功能。折射静校正软件必须在初至拾取后使用，可以用于采集过程的基准面静校正量计算，监控采集数据的质量，也可以用于室内处理项目的基准面静校正量的计算。因折射静校正利用了地震记录初至中包含的丰富的近地表信息，一般能获得较高精度的长、短波长静校正量，如短波长静校正量难以满足处理要求，也可以与初至波剩余静校正结合使用。折射法建立的近地表模型也可以作为层析反演的初始模型，有利于提高层析反演模型的精度。','KL-RefraStatics.exe','V1.0.0',1,'["/appImages/KL-RefraStatics-Chart-1.png","/appImages/KL-RefraStatics-Chart-2.png","/appImages/KL-RefraStatics-Chart-3.png"]','折射静校正（ KL-RefraStatics ）是 KLSeis下的一个应用软件。KL-RefraStatics 用于二维、三维初至折射层位划分及折射静校正量计算。折射静校正（KL-RefraStatics）是 KLSeis系统中基于初至波走时的折射法近地表建模与静校正计算软件。其主要功能包括基础数据的导入、观测系统定义与质控、折射速度计算（互换法、CMP 域拟合法）、延迟时计算（高斯迭代法、EGRM 方法、混合法等）、模型反演、折射静校正量计算、初至波剩余静校正量计算及相应的质量监控功能。折射静校正软件必须在初至拾取后使用，可以用于采集过程的基准面静校正量计算，监控采集数据的质量，也可以用于室内处理项目的基准面静校正量的计算。因折射静校正利用了地震记录初至中包含的丰富的近地表信息，一般能获得较高精度的长、短波长静校正量，如短波长静校正量难以满足处理要求，也可以与初至波剩余静校正结合使用。折射法建立的近地表模型也可以作为层析反演的初始模型，有利于提高层析反演模型的精度。',0,0,NULL);
INSERT INTO kl_app(app_id,app_name,category_id,version,description,logo,detail,app_start_item,base_package_version,type,charts,rich_text_detail,sort,runnable,image_url) VALUES (92,'近地表调查',4,1.0,'近地表调查','','近地表调查（KL-LVL）是 KLSeis系统中专门用于表层调查资料解释的软件，其主要功能包括：（1）小折射解释，能够处理单支、相遇双支、移动炮点或移动排列追踪等施工方式的小折射资料；（2）地面接收井中激发微测井解释；（3）井中接收地面激发微测井解释；（4）双井微测井解释；（5）长排列微测井解释。表层调查成果是近地表建模的重要基础资料，在静校正量计算和激发井深设计中发挥着重要作用。该软件主要用于野外采集后的小折射和微测井资料解释，也可以用于以往表层调查资料的重新解释与分析。','KL-LVL.exe','V1.0.0',1,'["/appImages/KL-LVL-Chart-1.png","/appImages/KL-LVL-Chart-2.png","/appImages/KL-LVL-Chart-3.png"]','近地表调查（KL-LVL）是 KLSeis系统中专门用于表层调查资料解释的软件，其主要功能包括：（1）小折射解释，能够处理单支、相遇双支、移动炮点或移动排列追踪等施工方式的小折射资料；（2）地面接收井中激发微测井解释；（3）井中接收地面激发微测井解释；（4）双井微测井解释；（5）长排列微测井解释。表层调查成果是近地表建模的重要基础资料，在静校正量计算和激发井深设计中发挥着重要作用。该软件主要用于野外采集后的小折射和微测井资料解释，也可以用于以往表层调查资料的重新解释与分析。',0,0,NULL);
INSERT INTO kl_app(app_id,app_name,category_id,version,description,logo,detail,app_start_item,base_package_version,type,charts,rich_text_detail,sort,runnable,image_url) VALUES (87,'共接收点道集数据监控',3,1.0,'共接收点道集数据监控','','KL-CRGQC是一个专门为节点地震采集数据现场质控而研发的软件，质控功能包括：能量、频率、信噪比、异常道、道集完整性检查等，质控功能全面。实现了节点回收后数据的快速质控，解决了常规通过炮集质控存在的节点数据质控严重滞后问题。','KL-CRGQC.exe','V1.0.0',1,'["/appImages/KL-CRGQC-Chart-1.png","/appImages/KL-CRGQC-Chart-2.png","/appImages/KL-CRGQC-Chart-3.png"]','KL-CRGQC是一个专门为节点地震采集数据现场质控而研发的软件，质控功能包括：能量、频率、信噪比、异常道、道集完整性检查等，质控功能全面。实现了节点回收后数据的快速质控，解决了常规通过炮集质控存在的节点数据质控严重滞后问题。',0,0,NULL);
INSERT INTO kl_app(app_id,app_name,category_id,version,description,logo,detail,app_start_item,base_package_version,type,charts,rich_text_detail,sort,runnable,image_url) VALUES (86,'噪音实时监测与分析',3,1.0,'噪音实时监测与分析','','待更新','KL-NoiseMonitor.exe','V1.0.0',1,'["/appImages/KL-NoiseMonitor-Chart-1.png","/appImages/KL-NoiseMonitor-Chart-2.png","/appImages/KL-NoiseMonitor-Chart-3.png"]','噪音实时监测与分析(KL-NoiseMonitor),用于在节点采集中的环境噪音监测与分析，噪音监测设备采用4G/5G节点。通过网络与云服务器连接，获取节点状态数据和实时采集数据，主要包括以下几个模块，（1）节点状态实时监测；（2）噪音数据实时监测及预警；（3）噪音数据实时统计及显示；（4）历史噪音数据统计分析；（5）历史噪音数据的快速回放。',0,0,NULL);
INSERT INTO kl_app(app_id,app_name,category_id,version,description,logo,detail,app_start_item,base_package_version,type,charts,rich_text_detail,sort,runnable,image_url) VALUES (90,'初至波二次定位',5,1.0,'初至波二次定位','','初至波二次定位软件（KL-FBP）针对节点数据的初至波二次定位软件，即根据拾取的初至，确定海底节点的坐标位置，包括初至拾取、定位计算、定位精度评价等功能。自动拾取包括高精度拾取和初至监控、初至编辑；定位计算包括多种计算方法和对定位结果的监控和评价等功能。','KL-FBPositioning.exe','V1.0.0',1,'["/appImages/KL-FBPositioning-Chart-1.png","/appImages/KL-FBPositioning-Chart-2.png","/appImages/KL-FBPositioning-Chart-3.png"]','初至波二次定位软件（KL-FBP）针对节点数据的初至波二次定位软件，即根据拾取的初至，确定海底节点的坐标位置，包括初至拾取、定位计算、定位精度评价等功能。自动拾取包括高精度拾取和初至监控、初至编辑；定位计算包括多种计算方法和对定位结果的监控和评价等功能。',0,0,NULL);
INSERT INTO kl_app(app_id,app_name,category_id,version,description,logo,detail,app_start_item,base_package_version,type,charts,rich_text_detail,sort,runnable,image_url) VALUES (98,'生产信息管理',5,1.0,'生产日报系统','','待更新','http://megashare.klseis.com','V1.0.0',1,NULL,'生产日报系统（KL-MegaShare），是一个为海洋地震采集业务量身定制的智能化综合信息管理平台。它集成了生产日报、经营管理、安全体系、船舶管理、设备管理以及人力资源管理等多项功能。作为地震队、物探处和公司机关三级部门的高效生产信息管理工具，KL-MegaShare不仅提升了生产管理的效率，还为智能决策提供了坚实的数据支持。',0,0,NULL);
INSERT INTO kl_app(app_id,app_name,category_id,version,description,logo,detail,app_start_item,base_package_version,type,charts,rich_text_detail,sort,runnable,image_url) VALUES (78,'三维地质建模',2,1.0,'三维地质建模','','KL3DGeoModeler作为KLSeis新平台系统中模型正演和波动照明共享的一个子系统模块，主要功能是利用剖面以及断层和层位解释数据以半自动或者交互编辑方式快速建立几何和拓扑一致的三维地质构造块体模型。在建模过程中，用户可以对剖面、层面、断面对象进行各种编辑和修改，可以输出虚拟现实格式的构造交切框架模型和三维无缝构造块体模型。建模生成的无缝构造块体模型可以用于三维速度建模和三维地震反演的初始地质模型建立，此外也可以支持三维正演模拟和基于模型的三维观测系统设计等。','KL-3DGeoModeler.exe','V1.0.0',1,'["/appImages/KL-3DGeoModeler-Chart-1.png","/appImages/KL-3DGeoModeler-Chart-2.png","/appImages/KL-3DGeoModeler-Chart-3.png"]','三维地质建模软件以非拓扑一致性块体构建技术为核心，支持剖面数据、散点数据、理论几何体及外部层面数据的融合建模，支持基于层面接触关系的自动交切裁剪，提升了块体构建成功率，降低了建模工作量，缩短了建模周期。',0,0,NULL);
INSERT INTO kl_app(app_id,app_name,category_id,version,description,logo,detail,app_start_item,base_package_version,type,charts,rich_text_detail,sort,runnable,image_url) VALUES (76,'可控震源扫描信号设计',1,1.0,'可控震源扫描信号设计','','可控震源扫描信号设计（Vibrator Sweep Signal Design）是 KLSeis下可控震源配套技术的其中一个应用软件。扫描信号设计是可控震源施工中一个关键的环节，它关系到可控震源在施工中的具体输出，对地震采集到的有效信息起决定性的作用。该软件一般用在地震勘探项目的前期，主要实现两个方面的功能：一是扫描信号参数的方法论证；二是试验、生产扫描信号的生成。软件操作简单，设计的信号类型多样，能适应各主流型号的震源箱体，充分满足用户需求。软件各功能模块相对比较独立，使用的主要流程都是通过数据树不同右键功能和相关动态菜单功能的配合使用，实现扫描信号的设计和方法论证，最后实现扫描信号的输出和相关论证图件的保存。','KL-VibSig.exe','V1.0.0',1,'["/appImages/KL-VibSig-Chart-1.png","/appImages/KL-VibSig-Chart-2.png","/appImages/KL-VibSig-Chart-3.png"]','在可控震源施工中，信号设计是一个关键的环节，它关系到可控震源在施工中的具体输出，对地震采集到的有效信息有决定性的作用。尤其是在高效可控震源采集中,参数设计如果不合理的话，会对后续的资料处理带来很大的麻烦。可控震源扫描信号设计与分析软件力求适应各主流型号震源，以最简单的操作完成扫描信号设计与分析。',3,0,NULL);
INSERT INTO kl_app(app_id,app_name,category_id,version,description,logo,detail,app_start_item,base_package_version,type,charts,rich_text_detail,sort,runnable,image_url) VALUES (89,'节点采集质量控制',5,1.0,'节点采集质量控制','','节点采集质量控制软件（KL-NodeQC）是一套包括地震数据切分、时钟漂移校正、旋转分析、质量控制等功能的综合应用软件，是陆上或海上采用节点仪器采集时进行质量控制的有效辅助工具。','KL-NodeQC.exe','V1.0.0',1,'["/appImages/KL-NodeQC-Chart-1.png","/appImages/KL-NodeQC-Chart-2.png","/appImages/KL-NodeQC-Chart-3.png"]','节点采集质量控制（KL-NodeQC）专门应用于OBN节点采集的数据切分及质控软件。其主要特色包括：（1）节点数据高速切分技术，日处理能力20TB以上；（2）支持多种主流节点类型；（3）多种方式的接收点道集切分（矩形、圆形、十字等）；（4）多种可选模型的时钟校正 、时钟误差交互分析、节点角度误差交互分析、批量节点角度自动计算等数据质控功能；（5）激发点属性信息检查、节点姿态检查、RMS质控及快照自动抓取、炮检点位置检查等属性质控功能。',0,0,NULL);
INSERT INTO kl_app(app_id,app_name,category_id,version,description,logo,detail,app_start_item,base_package_version,type,charts,rich_text_detail,sort,runnable,image_url) VALUES (74,'陆上地震采集设计',1,1.0,'陆上地震采集设计','','陆上地震采集设计软件（KL-LandDesign）是 KLSeis系统中的一个应用软件。其主要功能包括观测系统布设与编辑、采集参数论证、常规观测系统属性分析和叠前偏移观测系统属性分析与评价、GIS 辅助采集设计、障碍物定义与自动避障、海底采集设计等功能，实现了面向地质目标的采集设计和海陆地震采集联合设计，较好满足了陆地、过渡带等复杂地表区的地震采集设计需求。同时，为适应采集技术发展需要，在大数据、高效运算等方面具有较强的能力。KL-LandDesign 软件主要应用于地震采集项目招投标和陆上地震采集设计阶段，也可以用于地震资料处理过程中对不同观测系统的分析与评价。在地震采集项目施工现场，结合遥感数据、GIS 等信息，完成障碍物定义和批量处理、测线设计与评价、炮检点自动避障、施工难度分析、工作量统计分析等，实现了快速、精准的施工方案预设计。该软件强大的观测系统设计能力和灵活易用的交互编辑功能，以及丰富的观测系统属性分析及评价功能，可充分满足不同岗位人员、不同工作阶段的采集方案设计需求。','KL-LandDesign.exe','V1.0.0',1,'["/appImages/KL-LandDesign-Chart-1.png","/appImages/KL-LandDesign-Chart-2.png","/appImages/KL-LandDesign-Chart-3.png"]','陆上地震采集设计软件围绕勘探目标进行采集参数量化论证，高效实现城镇、沙漠、山地等各种复杂地表的观测方案优化设计，为勘探效益和工程造价评估提供数据支撑。',1,0,'');
INSERT INTO kl_app_i18n(source_id,app_name,description,id,language_code,detail,rich_text_detail) VALUES (82,'Seismic Data Analysis and Evaluation','Seismic Data Analysis and Evaluation',15,'en',NULL,'Seismic Data Analysis and Evaluation (KL-DataAE) is an application under KLSeis, and its main functions are to interactively analyze the following eight attributes: frequency spectrum, time-varying energy, time-frequency, signal-to-noise, F-K, signal-to-noise spectrum, energy and autocorrelation as well as make statistics to and analyze the above attributes and noise in batch. The software is usually installed in the computer at crew camp and is mainly used to interactively analyze field test data and compare attributes before formal seismic production to determine the optimal operation parameters. During seismic operation or after seismic operation, the software can be used to process seismic data in batch, make statistics and analyze, and evaluate the grades of seismic data for part or all work area, so the quality of seismic data can be qualitatively and quantitatively analyzed and evaluated by analyzing various attributes. During seismic acquisition design, the software can be used to analyze legacy data to determine reasonable acquisition plan and parameters.');
INSERT INTO kl_app_i18n(source_id,app_name,description,id,language_code,detail,rich_text_detail) VALUES (83,'Seismic Data Dump and QC','Seismic Data Dump and QC',16,'en',NULL,'Seismic Data Dump and QC (KL-SeisPro) under KLSeis is an application software that integrates the following functions: seismic data copying and dump, QC and data analysis. In the aspect of data dump, the software supports to synchronously export to multiple disks and tapes; is suitable for copying data in SEG-D 2.0 and 3.0 from instruments such as 428, G3i, Zland and GSR, etc.; support to dump between SEG-D and SEG-Y, and from SEG-D or SEG-Y to GeoEast; and supports hardcopy and data format parsing; supporst to merge or separate data. In the aspect of data QC, the software can judge suspicious shot by analyzing amplitude, frequency and frequency spectrum; perform QC by the relation between file header/trace header and SPS; and check the consistence between disk data and tape data to ensure the correctness of copied data. The software is mainly used to copy seismic data from disks to tapes in high productivity acquisition project for submitting tapes to client; also can be used to dump from field disks to indoor disks or convert formats for later onsite processing; and also can be used to process seismic data indoor, for example, demultiplex tape, shorten and merge SEG-Y data for picking first breaks by statics software; KL-SeisPro is installed in the computer at crew camp, the acquired single shot data can be quickly dumped and copied at the same day or on the next day, and QC is performed while copying tapes. KL-SeisPro also can be used to dump and parse legacy data, if the data format is not recognized, the software can determine data format by explicitly parsing data.');
INSERT INTO kl_app_i18n(source_id,app_name,description,id,language_code,detail,rich_text_detail) VALUES (94,'Tomography Statics','Tomography Statics',17,'en',NULL,'Tomography Statics (KL-TomoStatics) is an application software under KLSeis and includes first break residual statics method and the following three tomography statics methods: single scale grid tomography, multi-scale grid tomography and deformable tomography. The software can strongly suitable for areas with different near surface structures for it can solve the statics problems that are brought by long wavelength and big short wavelength.');
INSERT INTO kl_app_i18n(source_id,app_name,description,id,language_code,detail,rich_text_detail) VALUES (91,'Streamer Real-time QC','Streamer Real-time QC',18,'en',NULL,'Streamer Real-time QC (KL-StreamerRtQC) is used to perform QC to data from streamer seismic acquisition, can real-time monitor various indices of data from streamer seismic acquisition, and obtain gather data acquired, and then stack and analyze the data to obtain the energy variation in different domains, so shots, traces, cables and airgun excitation status, etc. can be monitored, which can complete the real-time monitoring function that is not done by navigation system, instrument recording system and airgun control system, the work status of cable devices can be monitored to direct onsite acquisition work and ensure the quality and productivity of streamer seismic acquisition.');
INSERT INTO kl_app_i18n(source_id,app_name,description,id,language_code,detail,rich_text_detail) VALUES (80,'3D Modeling and Illumination','3D Modeling and Illumination',19,'en',NULL,'3D Modeling and Illumination (KL-3DModeling) is a seismic acquisition auxiliary software that includes the following functions: load and preprocess 3D model, lay out or import 3D geometry, and wave equation modeling and illumination analysis, and the software can provide reference for optimizing 3D seismic acquisition geometry in complex areas.');
INSERT INTO kl_app_i18n(source_id,app_name,description,id,language_code,detail,rich_text_detail) VALUES (81,'Seismic Acquisition Real-time QC','Seismic Acquisition Real-time QC',20,'en',NULL,'Seismic Acquisition Real-time QC (KL-RtQC) is an application software under KLSeis, its main functions include: QC to various attributes of seismic data, QC to work status attributes of vibrator and statistics and analysis of various attribute QC results. In the aspect of seismic data attribute QC, the software supports G3i instrument and Scorpion instrument developed by INOVA, 408 instrument and 428 instrument developed by Sercel, and ES109 instrument developed by BGP, etc., and can real-time analyze and evaluate attributes such as seismic data quality (energy, frequency, signal-to-noise, etc.), acquisition parameters and noise, etc.. In the aspect of vibrator work status QC, the software can real-time monitor attributes such as drive force, phase and distortion, etc. as well as TD rule check, status code and downtime. KL-RtQC is mainly used to real-time monitor onsite in seismic acquisition operation, which is the key step of field acquisition onsite QC. QC computer is installed in instrument vehicle, connects instrument by network cable and is used to warn problematic single shot and device to avoid invalid shots in a large area. At the same time, in order to meet the requirements from high productivity and high density seismic acquisition project, the software has excellent performance for processing massive data and high efficient computing.');
INSERT INTO kl_app_i18n(source_id,app_name,description,id,language_code,detail,rich_text_detail) VALUES (85,'Vibrator and Recorder Quality Analysis','Vibrator and Recorder Quality Analysis',21,'en',NULL,'Vibrator and Recorder Quality Analysis (KL-VibEQA) is an application software under KLSeis. Vibrator and recorder quality analysis is one key step during vibroseis, at present, KL-VibEQA not only can perform QC and data management of work status of vibrator and recorder, but also can quickly analyze, collect and display data, which is convenient for field operation QC. The software is mainly used to perform indoor QC of work status of land seismic acquisition equipment (vibrator and recorder), it is usually used to perform QC to the data acquired at the same day or on previous day, and also can be used to perform QC and analysis to the data from the operation that is completed for a period, which belongs to later QC and verification analysis. Each function module of the software is comparatively independent, the main usage process is: firstly load QC data file into data tree, and then open it from data tree or menu, finally, view each result chart and QC report, etc..');
INSERT INTO kl_app_i18n(source_id,app_name,description,id,language_code,detail,rich_text_detail) VALUES (74,'Land Seismic Survey Design','Land Seismic Survey Design',31,'en',NULL,'Land Seismic Survey Design (KL-LandDesign) can quantitatively demonstrate acquisition parameters based on focusing on exploration targets, which can efficiently optimize geometry design in various complex terrains such as city, desert, and mountain, etc., and provide the support data for project cost evaluation.');
INSERT INTO kl_app_i18n(source_id,app_name,description,id,language_code,detail,rich_text_detail) VALUES (84,'Seismic Ancillary Data Tools','Seismic Ancillary Data Tools',22,'en',NULL,'Seismic Ancillary Data Tools (KL-ADTools) is an application software under KLSeis and is mainly used to process auxiliary data such as SPS file, e-observer’s log and VAPS file, etc. that are generated during seismic acquisition, and its main functions include: create geometry, data processing, e-observer’s log and productivity analysis, in addition, 2D or 3D geometry can be printed, and SPS data format in different versions can be converted. The software is usually installed in the computer of QC team at crew camp and is mainly used to sort seismic auxiliary data generated during seismic acquisition. According to field operation process, the following main work will be done: (1) create geometry according to actual source and receiver locations, export SPS and give it to instrument operator for shooting; (2) process SPS data from instrument according to client’s requirements to generate the files for submitting to client; (3) generate e-observer’s log in the required format by using the processed auxiliary data; (4) make statistics to productivity and analyze by using VAPS data from instrument.');
INSERT INTO kl_app_i18n(source_id,app_name,description,id,language_code,detail,rich_text_detail) VALUES (87,'Common receiver gather QC','Common receiver gather QC',23,'en',NULL,'Common receiver gather QC (KL-CRGQC) is developed for onsite QC to data from node seismic acquisition, and the QC functions include: energy, frequency, signal-to-noise, abnormal trace, and check the completeness of gather, etc.. QC to data can be quickly carried out after retrieving nodes, which solves the following problem: conventional QC to node data is done by shot gather, the QC time delays seriously.');
INSERT INTO kl_app_i18n(source_id,app_name,description,id,language_code,detail,rich_text_detail) VALUES (93,'First Break Picker','First Break Picker',24,'en',NULL,'First Break Picker (KL-FBPicker) is an application software under KLSeis. It is used to pick first breaks of 2D and 3D seismic data, i.e., automatically or interactively pick first break time of each trace of each shot for later statics calculation. The principle for picking first breaks: this method is to automatically pick first breaks of primary wave based on energy ratio iteration, firstly, calculate energy ratio between adjacent two time-windows of seismic data to determine first break according to ratio feature and the set energy parameter; then determine low creditable first break by using certain judgement conditions to evaluate; finally, re-pick the low creditable first break. KL-FBPicker is specially used to pick travel time of primary wave, and its main functions include: import base data in different formats, define geometry and QC, automatically pick, interactively pick, edit first breaks and QC, and export first breaks, etc.. The software is mainly used to provide base data for refraction statics, tomography statics, first break residual statics and first break positioning, etc. during the period between after completing seismic acquisition and before calculating statics based on travel time of primary wave.');
INSERT INTO kl_app_i18n(source_id,app_name,description,id,language_code,detail,rich_text_detail) VALUES (92,'Near Surface Survey','Near Surface Survey',25,'en',NULL,'Near Surface Survey (KL-LVL) under KLSeis is specially used to interpret near surface investigation data, and its main functions include: (1) process shallow refraction data from operation modes such as single branch method, common reciprocal method, moving sources or moving spread tracking, etc., and interpret the above data; (2) interpret the data from uphole with receiving on surface and exciting in hole; (3) interpret the data from uphole with receiving in hole and exciting on surface; (4) interpret the data from twin-well micro-logging; (5) interpret the data from long spread uphole. Near surface investigation results are the important base data for building near surface model, and play an import role in calculating statics corrections and designing well depth. The software is mainly used to interpret shallow refraction data and uphole data after field acquisition, and also can be used to re-interpret and re-analyze legacy near surface investigation data.');
INSERT INTO kl_app_i18n(source_id,app_name,description,id,language_code,detail,rich_text_detail) VALUES (95,'Refraction Statics','Refraction Statics',26,'en',NULL,'Refraction Statics (KL-RefraStatics) is an application software under KLSeis, is used to branch and calculate refraction statics corrections for 2D and 3D first breaks and build near surface model by refraction method based on travel time of primary wave. Its main functions include: import base data, define geometry and QC, calculate refraction velocity (reciprocal method, CMP domain fitting method), calculate delay time (Gauss iteration method, EGRM, hybrid method, etc.), model inversion, calculate refraction statics corrections, calculate first break residual statics corrections and the corresponding QC. The software can be used only after picking first breaks, and can be used to calculate datum statics corrections during seismic acquisition to monitor the quality of acquired data and calculate datum statics corrections of indoor processing project. Refraction statics uses rich near surface information contained in first breaks, so higher accurate statics corrections of long wavelength and short wavelength can be obtained, if the statics corrections of short wavelength can not meet the requirements of processing, first break residual statics can be combined to use. Near surface model created by refraction method can be used as the initial model of tomography inversion to improve the precision of tomography inversion model.');
INSERT INTO kl_app_i18n(source_id,app_name,description,id,language_code,detail,rich_text_detail) VALUES (96,'Near-Surface Investigation Based Statics','Near-Surface Investigation Based Statics',27,'en',NULL,'Near-Surface Investigation Based Statics (KL-LVLStatics) is an application software under KLSeis and is used to calculate the statics corrections of 2D and 3D model methods. KL-LVLStatics is one kind of model building method based on near surface investigation data, and its main model building functions include: similarity coefficient, time-depth curve, and regular grid database, etc..');
INSERT INTO kl_app_i18n(source_id,app_name,description,id,language_code,detail,rich_text_detail) VALUES (89,'Node Data QC','Node Data QC',29,'en',NULL,'Node Data QC (KL-NodeQC) is specially used to segment data from OBN and perform QC. Its main features include: (1) quickly segment node data, daily processing ability can reach more than 20TB; (2) support multiple types of main stream node; (3) segment multiple kinds of receiver gather (rectangle, circle, cross spread, etc.); (4) data QC functions for multiple kinds of model include: calibrate clock, interactively analyze clock error, and interactively analyze node angle error, auto-calculate node angles in batch, etc.; (5) attribute QC functions include: check source attribute information, check node orientation, RMS QC, auto-take snapshot, and check point positions, etc..');
INSERT INTO kl_app_i18n(source_id,app_name,description,id,language_code,detail,rich_text_detail) VALUES (90,'First Break Positioning','First Break Positioning',28,'en',NULL,'First Break Positioning (KL-FBP) is used to determine the coordinates of nodes at marine bottom according to first breaks. Its main functions include: pick first breaks, calculate for positioning, and evaluate positioning precision, etc., which can provide high accurate coordinate data for OBN acquisition, and its features include low cost positioning and high efficient positioning, etc..');
INSERT INTO kl_app_i18n(source_id,app_name,description,id,language_code,detail,rich_text_detail) VALUES (75,'Marine Seismic Survey Design','Marine Seismic Survey Design',37,'en',NULL,'null');
INSERT INTO kl_app_i18n(source_id,app_name,description,id,language_code,detail,rich_text_detail) VALUES (78,'3D Geological Modeler','3D Geological Modeler',34,'en',NULL,'3D Geological Modeler (KL-3DGeoModeler) uses the block body building technology by non-topology consistence as core technology, supports to build model by fusing section data, scattered point data, theoretic geometric body and external layer face data, and supports to automatically intersect, incise and clip based on layer face contact relation, which improves the success rate of building block body, reduces the workload of building model and shortens the period of building model.');
INSERT INTO kl_app_i18n(source_id,app_name,description,id,language_code,detail,rich_text_detail) VALUES (76,'Vibrator Sweep Signal Design','Vibrator Sweep Signal Design',30,'en',NULL,'In vibroseis operation, signal design is one key step, it relates to the detailed output during vibroseis operation and plays the decisive role for acquiring effective information. Especially, in high productivity vibroseis, if designed parameters are not reasonable, which will cause big trouble for later data processing. Vibrator Sweep Signal Design (KL-VibSig) tries to support various main stream vibrators and complete sweep signal design and analysis by the simplest operation.');
INSERT INTO kl_app_i18n(source_id,app_name,description,id,language_code,detail,rich_text_detail) VALUES (88,'Airgun Real-time QC','Airgun Real-time QC',32,'en',NULL,'Airgun Real-time QC (KL-AGQC) can quickly find the abnormal status of airgun by real-time analyzing airgun attributes and near field wavelet, the software can make statistics to the data of the whole line, perform bubble test and real-time simulate far field wavelet. Its main features include: (1) support multiple types of airgun controller and data; (2) real-time analyze six attributes: Delta, Misfire, Autofire, Depth, Pressure and Spread; (3) real-time align near field wavelets in multiple kinds of form; (4) bubble test; (5) use near field wavelet to simulate far field wavelet.');
INSERT INTO kl_app_i18n(source_id,app_name,description,id,language_code,detail,rich_text_detail) VALUES (77,'All-target Seismic Acquisition','All-target Seismic Acquisition',33,'en',NULL,'Based on ground object information and the features of geological targets, this module includes the following functions: acquisition parameter demonstration oriented to imaging points, the design based on even symmetry, and source and receiver grading layout based on AI, etc., which realizes “even random layout, acquiring through suitable grid, and imaging with flexible bin”.');
INSERT INTO kl_app_i18n(source_id,app_name,description,id,language_code,detail,rich_text_detail) VALUES (79,'2D Modeling and Illumination','2D Modeling and Illumination',38,'en',NULL,'null');
INSERT INTO kl_app_i18n(source_id,app_name,description,id,language_code,detail,rich_text_detail) VALUES (86,'Noise Real-time Monitoring and Analysis','Noise Real-time Monitoring and Analysis',36,'en',NULL,'Noise Real-time Monitoring and Analysis (KL-NoiseMonitor) is used to monitor and analyze ambient noise in node acquisition, and the equipment for monitoring noise is 4G/5G node. The software obtains node status data and real-time acquired data by internet and cloud server, and its main function modules include: (1) real-time monitor node status; (2) real-time monitor noise data and warn; (3) real-time make statistics to noise data and display; (4) make statistics to previous noise data and analyze; (5) quickly play back previous noise data.');
INSERT INTO kl_app_i18n(source_id,app_name,description,id,language_code,detail,rich_text_detail) VALUES (98,'Daily Production Report','Daily Production Report',35,'en',NULL,'Daily Production Report (KL-MegaShare) is an intelligent comprehensive information management platform customized for marine seismic acquisition. It integrates the following main functions: daily production report, operation management, safety system, vessel management, equipment management and human resource management, etc.. KL-MegaShare is used for high productivity production information management tool by crew, geophysical division and company’s management departments, which not only improves the efficiency of production management but also provides solid support data for intelligently making decisions.');
INSERT INTO kl_app_category(category_id,category_name,description,logo,code,context,charts,sort,image_url) VALUES (1,'陆上采集设计','采集设计','','cjsj','地震采集设计软件系列包括陆上地震采集设计软件、拖揽地震采集设计软件、数据驱动地震采集设计、采集工程实施模拟系统、二维弯线采集设计、VSP采集设计等软件，实现了面向地质目标的采集设计和海陆地震采集联合设计，满足了陆地、过渡带等各种复杂地表区的地震采集设计需求，具备支持大数据、高性能运算等能力。','["/appImages/KL-CATE-CJSJ-Chart-1.jpg"]',1,NULL);
INSERT INTO kl_app_category(category_id,category_name,description,logo,code,context,charts,sort,image_url) VALUES (3,'资料质控','资料质控','','zlzk','地震资料质控系列软件包括地震采集实时监控、节点采集质量控制、气枪实时质控、地震数据转储与质量监控等软件，能够完成节点及有线数据的质控、分析、转储和整理工作。','["/appImages/KL-CATE-ZLZK-Chart-1.png"]',3,NULL);
INSERT INTO kl_app_category(category_id,category_name,description,logo,code,context,charts,sort,image_url) VALUES (4,'近地表建模','近地表建模','','jjz','静校正技术系列软件包括近地表调查资料解释、近地表Q值计算及建模、大炮初至拾取、折射、层析及面波模型反演等软件，为采集全过程提供技术支撑，为资料处理提供高精度的静校正量和近地表速度模型。','["/appImages/KL-CATE-JDBJM-Chart-1.png"]',4,NULL);
INSERT INTO kl_app_category(category_id,category_name,description,logo,code,context,charts,sort,image_url) VALUES (5,'海洋采集','海洋采集','','hycj','海洋地震采集（KL-BlueWhale）蓝鲸系列软件包括海洋地震采集设计、节点采集质量控制、初至波二次定位、气枪实时质控、拖缆地震采集实时质控、生产信息管理共6个软件，满足了过渡带到深海的海洋地震采集设计、气枪激发、数据分析、质量控制、生产信息综合管理等全过程的业务需求。','["/appImages/KL-CATE-HYCJ-Chart-1.jpg"]',5,NULL);
INSERT INTO kl_app_category(category_id,category_name,description,logo,code,context,charts,sort,image_url) VALUES (2,'模型正演照明','模型正演','','mxzy','模型正演与照明系列包括二维模型正演与照明、三维地质建模、三维波动正演与照明分析等软件，能够完成二维、三维复杂构造建模、地震波场数值模拟和观测系统照明分析等工作，是复杂地表和复杂构造区域地震勘探采集设计的有效辅助工具。','["/appImages/KL-CATE-MXZY-Chart-1.png"]',2,'["http://10.88.247.18:38900/klseis/panel/v1/appSource/download/klseis-panel-category-pic/2_pic_1"]');
INSERT INTO kl_app_category_i18n(source_id,category_name,description,id,language_code,context) VALUES (1,'Land design','Land design',12,'en','Seismic acquisition design software series includes the following software: Land Seismic Survey Design (KL-LandDesign), Streamer Seismic Survey Design (KL-Streamer), Data Driven Seismic Survey Design (KL-DataDriven), Seismic Survey Operation Simulation (KL-oSim), Crooked Line Design (KL-Crooked), and 2D VSP Design (KL-2DVSPDesign), etc.. The series can carry out seismic acquisition design oriented to geological targets and land-marine joint seismic acquisition design, and meet the requirements of seismic acquisition design from various complex surfaces from land, marine and transitional zones, etc., and the series has the ability to support massive data and high performance computing, etc..');
INSERT INTO kl_app_category_i18n(source_id,category_name,description,id,language_code,context) VALUES (2,'Modeling and illumination','Modeling and illumination',13,'en','Modeling and illumination software series includes the following software: 2D Modeling and Illumination (KL-2DModeling), 3D Geological Modeler (KL-3DGeoModeler), 3D Modeling and Illumination (KL-3DModeling), etc., the series can carry out the following work: create 2D or 3D model with complex structure, numerically simulate seismic wave field, and perform illumination and analysis to geometry, etc., and is the effective auxiliary tools for seismic acquisition design in areas with complex surface and complex structure.');
INSERT INTO kl_app_category_i18n(source_id,category_name,description,id,language_code,context) VALUES (3,'Data QC','Data QC',14,'en','Seismic data QC software series includes the following software: Seismic Acquisition Real-time QC (KL-RtQC), Node Data QC (KL-NodeQC), Airgun Real-time QC (KL-AGQC), and Seismic Data Dump and QC (KL-SeisPro), etc., and can perform QC, analysis, dump and sorting to node data and wire data.');
INSERT INTO kl_app_category_i18n(source_id,category_name,description,id,language_code,context) VALUES (4,'Near surface model building','Near surface model building',15,'en','Statics technology software series includes the software for near surface investigation data interpretation, near surface Q value calculation and model building, first break picking, and refraction, tomography and surface wave inversion, etc., which provides technical support for the whole acquisition process and high accurate statics corrections and near surface velocity model for data processing.');
INSERT INTO kl_app_category_i18n(source_id,category_name,description,id,language_code,context) VALUES (5,'Marine acquisition','Marine acquisition',16,'en','Marine Seismic Acquisition Blue Whale (KL-BlueWhale) software series includes the following software: Marine Seismic Survey Design (KL-MarineDesign), Node Data QC (KL-NodeQC), First Break Positioning (KL-FBP), Airgun Real-time QC (KL-AGQC), and Marine Acquisition management (KL-MEGA), which meets the requirements of the whole process from seismic acquisition design, airgun shooting, data analysis, QC to comprehensive production information management, etc. from transitional zones to deep marine.');
